var tipuesearch = {"pages": [{'title': 'About', 'text': '40923114 \n 個人倉儲: \xa0 https://github.com/40923114/cd2022 \n 個人網站: \xa0 https://40923114.github.io/cd2022/content/index.html', 'tags': '', 'url': 'About.html'}, {'title': 'midterm', 'text': 'ag3分配: \n NX: \xa0 40923111 、 40923122 、 40923146 Onshape: \xa0 40923115 、 40923114 、 40923129 Solvespace: \xa0 40923148 、 40923209 \n \n 流程: 1.至 w8任務 頁面下載零件檔。 2.使用已分配的繪圖程式將零件繪出。 3.將零件檔轉為dwg檔，使用AutoCAD確認尺寸 4.繪製零件 5.將零件檔結合輸出成組合圖.STL。 6.將已繪製好的組合圖匯入 CoppeliaSim。 7.嘗試使用 CoppeliaSim設定並操作前三軸. \n 心得: \n 這次我被分配到的是onshape，上學期有稍微用過，大概知道怎麼做，但使用上還是有些不順手，速度很慢尺寸也有些不一樣，不會的地方也會跟同學討論，日後會更加精進自己的繪畫能力。 \n', 'tags': '', 'url': 'midterm.html'}, {'title': 'nx', 'text': '\n \n \n   \n', 'tags': '', 'url': 'nx.html'}, {'title': '進度', 'text': 'W6 \n blog \n W7 \n 設法以隨身程式系統編譯此程式碼 \n W8 \n 組員一起繪出零件圖 一起組立作動 \n W9 \n 期中考 \n w10 \n w10_block_ui \n w11 \n 加入個人 w8-w10 協同設計過程所負責的項目內容與心得 \n w12 \n 回答w8的問題 \n w13 \n 看歷屆畢業學長姐的考研資料 \n w14 \n 以程式碼驅動旋轉臂 \n w16 \n 測驗 回答問題 \n w17 \n w15 w16 檢查 \n', 'tags': '', 'url': '進度.html'}, {'title': 'w11s4', 'text': '', 'tags': '', 'url': 'w11s4.html'}, {'title': '14號', 'text': '\n W8:分配繪圖軟體 \n NX: \xa0 40923111 、 40923122 、 40923146 Onshape: \xa0 40923115 、 40923114、 40923129 Solvespace: \xa0 40923148 、 40923209 \n 心得 : \n 我被分配到的是onshape，上學期有稍微用過，大概知道怎麼做，但使用上還是有些不順手，速度很慢尺寸也有些不一樣，不會的地方也會跟同學討論，日後會更加精進自己的繪畫能力。 \n W10:在老師的Wink上添加註解 \n 心得 :我覺得在影片上註解非常重要，因為每個人的理解是不一樣的，有了註解能讓人淺顯易懂。 \n', 'tags': '', 'url': '14號.html'}, {'title': 'w12', 'text': '總共引用155個子零件 \n 個別零件總數為58 \n 零件採鋁製 總重量1.4123kg \n 零件採鋼製 總重量4.1062kg \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w16', 'text': '本周為測驗 \n https://mde.tw/cd2022_guide/content/Online%20Exam.html \n 第一題 遠端控制手臂 \n (1)將老師給的uarm_nx_tkinter_gui_control.ttt 打開 且按下啟動鍵 \n (2)啟動後按下\xa0 to connect 就可以模擬了 \n 第二題 方塊模擬 \n', 'tags': '', 'url': 'w16.html'}, {'title': '期末考周', 'text': '\n \n \n 1. 請各學員利用 \xa0 https://github.com/mdecycu/cd2022_guide/tree/main/downloads/w8_midterm/w8_uarm_nx12/uarm_robot_nx12 \xa0 目錄中的 uArm 機械手臂零件, 修改 "nx12絞鍊"與 "front joint" 零件的外型, 使能將 "Triangular connecting rod", "left link" 與 "end link" 等零組件, 與 "right crank" 與 "right link" 的組件左右互換. 各學員完成新 uArm 機械手臂組合檔案後, 請將零組件檔案放入個人 cd2022 倉儲 downloads 中的 w18/uarm 目錄後執行 acp, 並以 "完成期末考週 uarm 新組立檔案" 作為提交訊息.\n \n 2. 請各組員在完成題目 1. 的任務後, 在個人 cd2022 網頁中, 新增一個 H1 格式標題為 "期末考週" 的頁面, 並將題目 1. 的零組件繪圖過程, 以 Wink 影片展示過程細節說明, 並在頁面中說明所採用的 NX 套件版本與題目 1. 的任務執行心得. \n \n 3. 請在完成新幾何外型組立的 uArm 機械手臂後, 將組立件轉入 CoppeliaSim 4.3.0 rev3. 後, 套用 \xa0 https://www.coppeliarobotics.com/helpFiles/en/simUI-widgets.htm \xa0 圖形介面, 以 slider 控制前三軸的轉動. 完成後, 請在個人網頁的 "期末考週" 頁面, 加入第二個 Wink 影片展示過程細節說明. \n \n 4. 請在完成新幾何外型組立的 CoppeliaSim 場景後, 請與同組組員合作, 透過 \xa0 https://mde.tw/cd2022_guide/content/Visualization%20Stream.html \xa0 模式, 在 Teams 會議中, 以畫面分享及錄影功能, 由兩位 (含) 以上組員測試題目 3. 的 XML UI slider 控制功能. 完成錄影後, 請將影片 upload 至 Youtube 並嵌入參與學員的個人 "期末考週" 網頁後, 再整合至各分組網頁中的 "期末考週" 頁面, 並納入參與測試學員的心得. \n \n 5. 請接續題目 4. 的畫面分享與影片錄製模式, 由兩位 (含) 以上組員協同在新幾何外型組立的 uArm 機械手臂場景中, 加入 suctionPad 零件, 以手動操控或程式操控的方式, 錄製 block 方塊零件的取放模擬影片. 完成錄影後, 請將影片 upload 至 Youtube 並嵌入參與學員的個人 "期末考週" 網頁後, 再整合至各分組網頁中的 "期末考週" 頁面, 並納入參與測試學員的心得. \n \n6. 請接續題目 5. 的畫面分享與影片錄製模式, 由兩位 (含) 以上組員協同在新幾何外型組立的 uArm 機械手臂場景中, 以跨網路 Python remote API 的方式, 錄製圖形介面 slider 控制前三軸的轉動影片. 完成錄影後, 請將影片 upload 至 Youtube 並嵌入參與學員的個人 "期末考週" 網頁後, 再整合至各分組網頁中的 "期末考週" 頁面, 並納入參與測試學員的心得. \n \n \n', 'tags': '', 'url': '期末考周.html'}]};